import {useState} from "react";
import "./App.css";

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
// import {faPencilAlt, faTrash} from "@fortawesome/free-solid-svg-icons";
import {faTrash} from "@fortawesome/free-solid-svg-icons";

function App() {
  const [patienter, setPatienter] = useState([
    {id: 12345, plats: "101", datum: "2023-09-30", fvk: "LEB"},
    {id: 67890, plats: "111", datum: "2023-10-10", fvk: "MD"},
  ]);
  //  state för ny patient - start in = input
  const [inPlats, setInPlats] = useState("");
  const [inDatum, setInDatum] = useState("");
  const [inKontakt, setInKontakt] = useState("");

  //  state för redigering
  const [redigeradPatient, setRedigeradPatient] = useState(null);

  //funktioner som ska vara i appen
  const uniqueId = () => {
    return new Date().getTime(); // Ersätt med din egen unika ID-genereringslogik
  };

  const handleSubmitNypatient = (e) => {
    e.preventDefault();
    const nyPatient = {
      id: uniqueId(),
      plats: inPlats,
      datum: inDatum,
      fvk: inKontakt,
    };
    setPatienter((prevPatienter) => [...prevPatienter, nyPatient]);
    setInPlats("");
    setInDatum("");
    setInKontakt("");
  };

  const startRedigering = (patient) => {
    // kopiera patientobjekt
    setRedigeradPatient({...patient});
  };

  const sparaRedigering = () => {
    if (redigeradPatient) {
      setPatienter((prevPatienter) => {
        return prevPatienter.map((patient) => {
          return patient.id === redigeradPatient.id
            ? redigeradPatient
            : patient;
        });
      });
      setRedigeradPatient(null);
    }
  };

  const deletePatient = (id) => {
    setPatienter((prevPatienter) => {
      return prevPatienter.filter((p) => p.id !== id);
    });
  };

  return (
    <div className="App">
      <h1>Teest</h1>
      <br />

      {/* ny patient form - start */}
      <div className="card">
        <form onSubmit={handleSubmitNypatient}>
          <div className="form-container">
            <div className="va-container">
              <input
                type="text"
                value={inPlats}
                onChange={(e) => setInPlats(e.target.value)}
              />
              <input
                type="text"
                value={inKontakt}
                onChange={(e) => setInKontakt(e.target.value)}
              />
              <input />
            </div>
            <div className="ho-container">
              <input
                type="date"
                value={inDatum}
                onChange={(e) => setInDatum(e.target.value)}
              />
              <input />
              <input />
            </div>
          </div>
          <div className="btn-container">
            <button type="submit">Spara</button>
          </div>
        </form>
      </div>

      {/* tabell av patienter */}
      <table className="table">
        <thead>
          <tr>
            <th>Plats</th>
            <th>Datum</th>
            <th>FVK</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
          {patienter.map((patient) => (
            <tr key={patient.id}>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <input
                    type="text"
                    value={redigeradPatient.plats}
                    onChange={(e) =>
                      setRedigeradPatient({
                        ...redigeradPatient,
                        plats: e.target.value,
                      })
                    }
                  />
                ) : (
                  patient.plats
                )}

                {/* <span style={{color: "green", margin: "10px"}}>
                    <FontAwesomeIcon
                      icon={faPencilAlt}
                      size="xs"
                      data-tip="Redigera plats"
                      onClick={() => startRedigering(p)}
                    />
                  </span> */}
              </td>
              <td>{patient.datum}</td>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <input
                    type="text"
                    value={redigeradPatient.fvk}
                    onChange={(e) =>
                      setRedigeradPatient({
                        ...redigeradPatient,
                        fvk: e.target.value,
                      })
                    }
                  />
                ) : (
                  patient.fvk
                )}
              </td>
              <td>
                {redigeradPatient && redigeradPatient.id === patient.id ? (
                  <button onClick={sparaRedigering}>Spara</button>
                ) : (
                  <button onClick={() => startRedigering(patient)}>
                    Redigera
                  </button>
                )}
              </td>

              <td>
                <span style={{color: "red", margin: "3px"}}>
                  <FontAwesomeIcon
                    icon={faTrash}
                    size="lg"
                    onClick={() => deletePatient(patient.id)}
                  />
                </span>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
